function generateEstimationLists(DATA) {
  const E_list = [];
  const P_list = [];
  const increase_probs = [];
  const s_obs_list = [];

  for (let i = 0; i < DATA.rounds.length; i++) {
    const round = DATA.rounds[i];

    // Skip the first 5 rounds
    if (i <= 4) continue;

    // Skip rounds where r == 40
    if (round.r <= 9 || round.r === 50) continue;

    const a = round.a;
    const p = round.p;
    const c = round.c;
    const prob = round.prob;

    if (
      typeof a !== "number" ||
      typeof p !== "number" ||
      typeof c !== "number" ||
      typeof prob !== "number" ||
      isNaN(a * p + c)
    ) {
      console.warn("Skipping invalid round at index", i, round);
      continue;
    }

    const E = a * p + c;

    E_list.push(E);
    P_list.push(p);
    increase_probs.push(prob);
    s_obs_list.push(a);
  }

  return { E_list, P_list, increase_probs, s_obs_list };
}
